import React from 'react';
import {Button, StyleSheet, Text, TextInput, View} from 'react-native';
import {NitroWallet} from 'react-native-nitro-wallet';

function App(): React.JSX.Element {
  const [count, setCount] = React.useState(0);
  const [count2, setCount2] = React.useState(0);

  return (
    <View style={styles.container}>
      <Text style={styles.text}>{NitroWallet.sum(1, 2)}</Text>
      <TextInput value={count.toString()} />
      <TextInput value={count2.toString()} />
      <Button title="1+" onPress={() => setCount(NitroWallet.sum(count, 1))} />
      <Button
        title="2+"
        onPress={() => setCount2(NitroWallet.sum(count2, 2))}
      />
      <Button
        title="Add Pass"
        onPress={() =>
          NitroWallet.addPassToAppleWallet(
            '',
          )
        }
      />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  text: {
    fontSize: 40,
    color: 'green',
  },
});

export default App;
